import React from 'react'
import {CartProvider} from "react-use-cart"
import GalleryReact from '../components/tabProduct/GalleryReact';
import Cart from "../components/cart/Cart"


const Products = () => {
  return (
    <>
      <CartProvider>
     <GalleryReact/>
     <Cart/>  
      </CartProvider>
    </>
  )
}

export default Products;
